import { Button, Tooltip } from "antd";

function App() {
  return (
    <div>
      <h2>Estamos en APP</h2>
      <Tooltip title="search">
        <Button type="primary" shape="circle" />
      </Tooltip>
    </div>
  );
}

export default App;
